import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route } from 'react-router-dom';
import Home from './Pages';
import Login from './Pages'

function App() {
  return (
    <Router>
      <>
        <Route path="" component={Home} exact /> 
      </>
    </Router>
  );
}

export default App;
